import "./NavBar.scss";
import Scroll from 'react-scroll';

const Link = Scroll.ScrollLink;

const NavBar = () => {
  return (
    <nav className="nav">
      <ul>
        <Link to="name" duration={400}>
          Home
        </Link>
        <Link>About</Link>
        <Link>Work</Link>
        <Link>Contact</Link>
      </ul>
    </nav>
  );
};

export default NavBar;
